import { Box, Text, Image} from "@chakra-ui/react";
import feedbackExample from "../../assets/i/feedback.png";
import telegram from "../../assets/i/telegram.svg";
import arrowLeft from "../../assets/i/arrowLeft.svg"
import arrowRight from "../../assets/i/arrowRight.svg"


function Feedbacks() {
  return (
    <Box id={"feedbacks"} display={"flex"} flexDirection={"row"} gap={"20px"} >
        <Text  m={"112px 0px 0px 67px"}
        fontSize={"60px"}
        fontWeight={"500"}
        letterSpacing={"-0.06em"}>Отзывы</Text>

        <Box>
          <Box>
            <Image src={feedbackExample}></Image>
            <Box>
                <Box>
                    <Text>Иван Иванов</Text>
                    <Text>25 лет</Text>
                </Box>
                <Image src={telegram}/>
            </Box>
          </Box>

          <Box>
            <Text></Text>
            <Box>
              <Image src={arrowLeft}/>
              <Image src={arrowRight}/>
            </Box>
          </Box>

        </Box>
    </Box>

  );
}

export default Feedbacks;
